import React from "react";

const pageStyle = {
  background: "#f3e5f5",
  borderRadius: "1rem",
  padding: "2rem"
};

export default function Dashboard() {
  return (
    <div style={pageStyle}>
      <h2>Dashboard</h2>
      <div style={{ background: "#e1bee7", borderRadius: "0.5rem", padding: "1rem", marginBottom: "2rem" }}>
        <p>Welcome to the Order Management System.</p>
        <p>Use the navigation bar above for Products, Orders, and Shipping.</p>
      </div>
      {/* You can add summary cards or stats here */}
    </div>
  );
}
